kibana.curl_call:
curl -XGET http://elasticsearch02.openstack.org:9200/logstash-2014.11.25/_search?pretty -d '{
  "from": 0,
  "query": {
    "filtered": {
      "query": {
        "query_string": {
          "default_operator": "OR",
          "default_field": "message",
          "query": "message:\"Looks like the node went offline during the build\" AND message:\"slave.log \\(No such file or directory\\)\" AND tags:\"console.html\"\n"
        }
      },
      "filter": {
        "range": {
          "@timestamp": {
            "from": "2014-11-15T22:04:23+00:00",
            "to": "2014-11-25T22:04:23+00:00"
          }
        }
      }
    }
  },
  "sort": {
    "@timestamp": {
      "order": "desc"
    }
  },
  "size": 500
}'
